import {BrowserRouter as Router, Route} from "react-router-dom";
import NewJoin from "./component/Join/NewJoin.js";

function App() {

  return (
    <>
      <div className="App">
        <BrowserRouter>
          <Router>
            <Route path="/" Component={NewJoin}/>
            <Route path="/chat"/>
          </Router>
        </BrowserRouter>
      </div>
    </>
  );
}

export default App;
